import React, { Component } from 'react'
import axios from 'axios'
import DatePicker from 'react-datepicker'
import 'react-datepicker/dist/react-datepicker.css'
import { useParams } from "react-router-dom";


function withParams(Component) {
    return props => <Component {...props} params={useParams()} />;
  }




class CreateChar extends Component {

    constructor(props){
        super(props);

        this.state = {
            val: 0,
        };
    }

    state={
        _id: '',
        nombre: "",
        clase: "",
        raza: "",

        fuerza: "",
        destreza: "",
        constitucion: "",
        inteligencia: "",
        sabiduria: "",
        carisma: "",
        val: 0,


    }

    add = () => {
            this.setState({val: this.state.value + 1});
    }

    async componentDidMount(){
        const res = await axios.get('http://localhost:4000/chars')

        this.setState({



        })

        if(this.props.params.id){
            const res = await axios.get('http://localhost:4000/chars' + this.props.params.id);
            this.setState({
               _id: this.props.params.id,

               nombre: res.data.nombre,
               clase: res.data.clase,
               raza: res.data.raza,

            fuerza: res.data.fuerza,
            destreza: res.data.destreza,
            constitucion: res.data.constitucion,
            inteligencia: res.data.inteligencia,
            sabiduria: res.data.sabiduria,
            carisma: res.data.carisma


            })
        }
    }


    onSubmit = async (e) => {
        e.preventDefault();
        const newChar ={


            nombre: this.state.nombre,
            clase: this.state.clase,
            raza: this.state.raza,

            fuerza: this.state.fuerza,
            destreza: this.state.destreza,
            constitucion: this.state.constitucion,
            inteligencia: this.state.inteligencia,
            sabiduria: this.state.sabiduria,
            carisma: this.state.carisma


        }
        if(this.state.editing){
            await axios.put('http://localhost:4000/chars' + this.state._id, newChar)
        }else{
            await axios.post('http://localhost:4000/chars', newChar);
        }

        window.location.href = '/';
    }
    onInputChange = (e) => {
        this.setState({
            [e.target.name]: e.target.value,

        })
    }
    onChangeDate = date => {
        this.setState({date})
    }

    render(){
        return(
            <div className="col-md-6 offset-md-3">
                 <div className="card card-body">
                    <h4>Aqui inicia tu destino</h4>
                    <div className="form-group">

                    {/* Nombre */}
                    <label>Nombre: </label>
                    <input 
                            type="text" 
                            className="form-control" 
                            placeholder="Inserta tu nombre, lord" 
                            name="nombre"
                            onChange={this.onInputChange}
                            value={this.state.nombre}
                            required/> 

                    {/* Clase */}
                    <label>Clase: </label>
                    <select
                    className="form-control"
                    name="clase"
                    onChange={this.onInputChange}
                    value={this.state.clase}
                    >
                        <option>Guerrero</option>
                        <option>Mago</option>
                        <option>Bribon</option>



                    </select>
                    <br></br>
                     {/* Raza */}
                     <label>Raza: </label>
                    <select
                    className="form-control"
                    name="raza"
                    onChange={this.onInputChange}
                    value={this.state.raza}                   
                    >
                        <option>Humano</option>
                        <option>Elfo</option>
                        <option>Enano</option>
                        <option>Mediano</option>
                    </select>

                </div>

            <div className="container">
                <div className="row">
                        <div className="col-sm">
                        Fuerza
                        <input  onChange={this.onInputChange} value={this.state.fuerza} type="number" id="quantity" name="fuerza" min="1" max="5"></input>
                        </div>
                        <div className="col-sm">
                        Destreza
                        <input  onChange={this.onInputChange} value={this.state.destreza} type="number" id="quantity" name="destreza" min="1" max="5"></input>
                        </div>
                        <div className="col-sm">
                        Constitucion
                        <input  onChange={this.onInputChange} value={this.state.constitucion} type="number" id="quantity" name="constitucion" min="1" max="5"></input>
                        </div>
                </div>
            </div>

            <div className="container">
                <div className="row">
                        <div className="col-sm">
                        Inteligencia
                        <input  onChange={this.onInputChange} value={this.state.inteligencia} type="number" id="quantity" name="inteligencia" min="1" max="5"></input>
                        </div>
                        <div className="col-sm">
                        Sabiduria
                        <input  onChange={this.onInputChange} value={this.state.sabiduria} type="number" id="quantity" name="sabiduria" min="1" max="5"></input>
                        </div>
                        <div className="col-sm" >
                        Carisma
                        <input  onChange={this.onInputChange} value={this.state.carisma} type="number" id="quantity" name="carisma" min="1" max="5"></input>
                        </div>
                </div>
            </div>

                <form onSubmit={this.onSubmit}>
                        <button type="submit" className="btn btn-primary">
                            Guardar
                        </button>
                    </form>

                    <form>
                        <button type="submit" className="btn btn-primary" onClick={this.add}>
                            {this.state.val}
                        </button>
                    </form>

            </div>
        </div>
        )
    }

}
export default withParams(CreateChar);
